Comment utiliser avec [Spring Framework][1]
La manière la plus simple est de générer automatiquement le fichier de configuration XML de Spring et d'ajouter simplement les paramètres de configuration ci-dessus dans le fichier XML de contexte.
Si vous souhaitez gérer vous-même toutes les validations, vous pouvez ajouter les lignes suivantes pour la configuration :
@Bean(name="validationProfile")
public Profile validationProfile(){
Profile profile = new Profile();
profile.getParams().put("ignore_field_missing", "false");
profile.put("messages_files","[votre fichier de messages personnalisé]");
CustomRule rule = new CustomRule("my.company.MyRules");
profile .registerCustomRule(rule);
returnprofile ;
}
